import React from 'react';
import './App.css';
import HeaderComponent from "./Components/Header/Header";

function App() {
  return (
      <div className="container">
          <HeaderComponent />
        <h1 className="mt-5">Hello, Bootstrap!</h1>
        <button className="btn btn-primary">Click Me</button>
      </div>
  );
}

export default App;
